aption":"Photo shared by coline pic / aka oblio (-iel) on April 19, 2020 tagging @rock_prick, @bole_bol.e, and @confinages.","edge_media_to_caption":{"edges":[{"node":{"text":"bole_bol.e, instalation perform\u00e9, ficelle mie de pain papier, Confinage Galerie, 2020\n\nNotice de construction de l\u2019installation\n1. Bien se laver les mains\n2. Faire 6 boulettes d\u2019un diam\u00e8tre de 2.5 cm avec la mie d\u2019une baguette de pain (mesurer \u00e0 l\u2019aide d\u2019une r\u00e8gle )\n3. Prendre le centre du mur et y aligner en bas de de celui ci les 6 boulettes (\u00e0 exactement 8 cm du mur)\n4. Couper un morceau de ficelle blanche de 16 cm\n5. La placer sur le dessus tout le long de la rang\u00e9 de boulettes, bien au centre de leurs sommets\n6. Utiliser une aiguille pour faire en sorte que la ficelle longe les creux entre chaque boulette\n7. D\u00e9couper le dessin ci joint sur les pointill\u00e9s pr\u00e9vus \u00e0 cet effet8. Le coller au centre du mur avec un seul scotch au centre de la feuille.\nD\u00e9roulement du live et autre indication : - Tout le procesus de travail sera montr\u00e9 pendant le live. - Le mat\u00e9riel devra \u00eatre pr\u00e9par\u00e9 au pr\u00e9alable et plac\u00e9 de mani\u00e8re ordonn\u00e9e sur le sol : mie de pain, dessin imprim\u00e9, scotch, ciseau, bobine de ficelle, aiguille pour placer la ficelle entre les creux, m\u00e8tre pour mesurer le centre du mur, r\u00e8gle pour mesurer les boulettes. - Durant le temps de travail : faire un plan serr\u00e9 sur tes mains qui forment les boulettes et coupe le scotch, puis un plan d\u2019ensemble de toi qui place les objets (temps estim\u00e9 6 \u00e0 8 min ) - Un compte myst\u00e9re nomm\u00e9 bole_bole est invit\u00e9 sur le live : apparait une boulette de pain en plan serr\u00e9 sur une surface blanche - Ensuite plan centr\u00e9 plus proche du dessin \u00e0 environ 1 m, assez pour qu\u2019on le voit le correctement (durant 20 min). Pendant ce lapse de temp bole_bole fait un son \u0       bundle_variant: getConfigProp('bundle_variant', null),
      request_url: errUrl.indexOf('direct') >= 0 ? 'direct' : errUrl,
      response_status_code: errorInfo.statusCode || 0
    }
  }
  window.addEventListener('load', function(){
    if (window.__bufferedErrors && window.__bufferedErrors.length) {
      if (window.caches && window.caches.keys && window.caches.delete) {
        window.caches.keys().then(function(keys) {
          keys.forEach(function(key) {
            window.caches.delete(key)
          })
        })
      }
      window.__bufferedErrors.map(function(error) {
        return normalizeError(error)
      }).forEach(function(normalizedError) {
        var request = new XMLHttpRequest();
        request.open('POST', '/client_error/', true);
        request.setRequestHeader('Content-Type', 'application/json; charset=utf-8');
        request.send(JSON.stringify(normalizedError));
      })
    }
  })
}());
</script>
